import { Given, When, Then } from '@wdio/cucumber-framework';
import Page from '../pageobjects/page';
import LoginPage from '../pageobjects/login.page';
import LandingPage from '../pageobjects/landing.page';

const {
  config
} = require('../../wdio.conf');

const page = new Page();
const pages = {
  'login': loginPage
