import { Given, When, Then } from '@wdio/cucumber-framework';
import Page from '../pageobjects/page';
import LoginPage from '../pageobjects/login.page';
import LandingPage from '../pageobjects/landing.page';
const { config } = require('../../wdio.conf');

const page = new Page();

const pages = {
    'login': loginPage,

}

Given(/^I am on the (.*) page$/, async (page) => {
    await pages[page].open();
});

When('I login with {string} and {string}', async (email, password) => {
    await LoginPage.loginWithEmail(email, password);
});

Then(/^I should be in Udemy landing page$/, async () => {
    await LandingPage.verifyUrl("https://www.udemy.com");
    await LandingPage.whatTolearnTxt.waitForDisplayed();
    browser.closeWindow
});

